        public static int get(int h1, int h2)
        {
            return comb[h1][h2];
        }

        public static int get(Hand h1, Hand h2, Hand h3)
        {
            int res = 1;
            ResetCardsLeft();
            res *= ChangeCardRange(h1);
            res *= ChangeCardRange(h2);
            res *= ChangeCardRange(h3);
            return res;
        }

        static int[] Cardsleft = new int[13];

        static void ResetCardsLeft()
        {
            for (int i = 0; i < 13; i++)
            {
                Cardsleft[i] = 4;
            }
        }

        static int ChangeCardRange(Hand h1)
        {
            int res = 1;
            int card1 = h1.getValue() / 13;
            int card2 = h1.getValue() % 13;
            int c1 = Cardsleft[card1];
            int c2 = Cardsleft[card2];
            if (c1 > c2)
            {
                int t = c2; c2 = c1; c1 = t;
            }
            if (h1.ToString().Length > 2)
            {
                if (h1.ToString()[2] == 's')
                {
                    res = c1;
                }
                else // h1.ToString()[2] == 'o'
                {
                    res = c1 * (c2 - 1);
                }
            }
            else // pocket pair
            {
                res = (c1 * (c1 - 1)) / 2;
            }
            Cardsleft[card1]--;
            Cardsleft[card2]--;
            return res;
        }

        public static double RangeProbabilityKnowingHand(int h, Range r2)
        {
            //int h = h1.getValue();
            double resultCombos = 0.0;
            for (int i = 0; i < 169; i++)
            {
                resultCombos += comb[i][h] * r2.probability[i];
            }
            return resultCombos / 1225.0;
        }
    }
